#@  'YieldToEmergencyVehicle/Town12_Rep0_4329_1_route0_11_08_23_44_22',
#@  'YieldToEmergencyVehicle/Town12_Rep0_4477_0_route0_11_08_00_46_21',
#@  'YieldToEmergencyVehicle/Town12_Rep0_4477_1_route0_11_08_03_32_21',
#@  'YieldToEmergencyVehicle/Town12_Rep0_4483_0_route0_11_08_07_19_24',
#@  'YieldToEmergencyVehicle/Town12_Rep0_4483_1_route0_11_08_12_48_13',
#@  'YieldToEmergencyVehicle/Town12_Rep0_4485_0_route0_11_09_02_17_39',
#@  'YieldToEmergencyVehicle/Town12_Rep0_4485_1_route0_11_08_03_40_13',
#@  'YieldToEmergencyVehicle/Town12_Rep0_4511_0_route0_11_07_23_55_40',
#@  'YieldToEmergencyVehicle/Town12_Rep0_4516_0_route0_11_08_01_51_30',
#@  'YieldToEmergencyVehicle/Town12_Rep0_4516_1_route0_11_09_04_21_09',
#@  'YieldToEmergencyVehicle/Town12_Rep0_4524_0_route0_11_08_00_49_44',
#@ ]
#@ cameras = [
#@     'rgb',
#@ ]
---
_target_: rbyte.Dataset
_recursive_: false
_convert_: all
sources:
  #@ for input_id in drives:
  (@=input_id@):
    #@ for source_id in cameras:
    (@=source_id@):
      index_column: meta/_idx_
      source:
        _target_: rbyte.io.PathTensorSource
        path: "${paths.data}/(@=input_id@)/(@=source_id@)/{:04d}.jpg"
        decoder:
          _target_: simplejpeg.decode_jpeg
          _partial_: true
          colorspace: rgb
          fastdct: true
          fastupsample: true

    #@ end
  #@ end

samples:
  inputs:
    #@ for input_id in drives:
    (@=input_id@):
      measurements_path: ${paths.data}/(@=input_id@)/measurements.json
      waypoints_path: ${paths.data}/(@=input_id@)/waypoints.json
    #@ end

  executor:
    _target_: concurrent.futures.ProcessPoolExecutor
    mp_context:
      _target_: multiprocessing.get_context
      method: forkserver

  storage: shared_memory_dict
  scheduling_strategy: eager
  persist_memory: false
  
  pipeline:
    _target_: pipefunc.Pipeline
    validate_type_annotations: false
    functions:
      - _target_: pipefunc.PipeFunc
        renames:
          path: measurements_path
        output_name: meta
        mapspec: "measurements_path[i] -> meta[i]"
        func:
          _target_: rbyte.io.DuckDbDataFrameBuilder
        bound:
          query: |
            LOAD spatial;
            SELECT (row_number() OVER () - 1) as _idx_,
                   speed,
                   steer,
                   throttle,
                   brake::DOUBLE AS brake,
                   ST_AsWKB(ST_Point(pos_global[2], pos_global[1])) AS pos_global
            FROM (SELECT unnest(records, recursive := true)
                  FROM read_json('{path}')
            )

      - _target_: pipefunc.PipeFunc
        renames:
          path: waypoints_path
        output_name: waypoints_raw
        mapspec: "waypoints_path[i] -> waypoints_raw[i]"
        func:
          _target_: rbyte.io.DuckDbDataFrameBuilder
        bound:
          query: |
            LOAD spatial;
            SELECT timestamp, heading, ST_AsWKB(geom) AS geometry
            FROM ST_Read('{path}')
            ORDER BY timestamp

      - _target_: pipefunc.PipeFunc
        renames:
          input: waypoints_raw
        output_name: waypoints
        mapspec: "waypoints_raw[i] -> waypoints[i]"
        func:
          _target_: rbyte.io.WaypointBuilder
          length: 10
          columns:
            points: geometry
            output: xy

      - _target_: pipefunc.PipeFunc
        output_name: data
        mapspec: "meta[i], waypoints[i] -> data[i]"
        func:
          _target_: pipefunc.helpers.collect_kwargs
          parameters: [meta, waypoints]
          function_name: aggregate

      - _target_: pipefunc.PipeFunc
        renames:
          input: data
        output_name: aligned
        mapspec: "data[i] -> aligned[i]"
        func:
          _target_: rbyte.io.DataFrameAligner
          separator: /
          fields:
            meta:
              key: _idx_
              columns:
                speed:
                  method: interp
                steer:
                  method: interp
                throttle:
                  method: interp
                brake:
                  method: interp
                pos_global:
                  method: asof
                  strategy: nearest

            waypoints:
              key: timestamp
              columns:
                heading:
                  method: asof
                  strategy: nearest
                waypoints:
                  method: asof

      - _target_: pipefunc.PipeFunc
        renames:
          input: aligned
        output_name: with_waypoints_normalized
        mapspec: "aligned[i] -> with_waypoints_normalized[i]"
        func:
          _target_: rbyte.io.WaypointNormalizer
          columns:
            ego: meta/pos_global
            waypoints: waypoints/waypoints
            heading: waypoints/heading
            output: waypoints/xy

      - _target_: pipefunc.PipeFunc
        renames:
          df: with_waypoints_normalized
        output_name: filtered
        mapspec: "with_waypoints_normalized[i] -> filtered[i]"
        func:
          _target_: rbyte.io.DataFrameDuckDbQuery
        bound:
          query: |
            SELECT *
            FROM df
            WHERE COLUMNS(*) IS NOT NULL

      - _target_: pipefunc.PipeFunc
        renames:
          input: filtered
        output_name: samples
        mapspec: "filtered[i] -> samples[i]"
        func:
          _target_: rbyte.io.DataFrameGroupByDynamic
          index_column: meta/_idx_
          every: 1i
          period: 8i

      - _target_: pipefunc.PipeFunc
        renames:
          df: samples
        output_name: samples_cast
        mapspec: "samples[i] -> samples_cast[i]"
        func:
          _target_: rbyte.io.DataFrameDuckDbQuery
        bound:
          query: |
            SELECT
                "meta/_idx_"::INT32[8] AS "meta/_idx_",
                "meta/speed"::FLOAT[8] AS "meta/speed",
                "meta/steer"::FLOAT[8] AS "meta/steer",
                "meta/throttle"::FLOAT[8] AS "meta/throttle",
                "meta/brake"::FLOAT[8] AS "meta/brake",
                "waypoints/xy_normalized"::FLOAT[2][10][8] AS "waypoints/xy_normalized",
            FROM
                df
            WHERE
                array_length("meta/_idx_") == 8
